import React,{ Component } from 'react';
import "./Hello.css";


class Hello extends Component {
    render() {
        return  (
            <div className='body1'>
            <img className='team' src={Logo} />
            <div className="body-text">
                <h1 className='body-text1'>IEEE SPS</h1>
                <p className='body-text2' >IEEE SPS is a student chapter in VIT
            Vellore aimed at enhancing skills of its members in various domains through
            quality projects and events tailored for cutting edge skill development</p>
            </div>
        </div>
        );
    }
}


